  false,\n\t\"url\": null,\n\t\"notes\": \"The lower portion of the Missisquoi River
  main stem, from the delta at Lake Champlain to the principle fall line at Highgate
  Falls was intensively surveyed in 1998 to assess the abundance, density, and distribution
  of a targeted set of seven regionally rare mussel species known from the river:
  Black sandshell, Cylindrical paper shell, Pocketbook, Fluted shell, Fragile papershell,
  Pink heelsplitter, Giant floater. This report outlines the results and provides
  some historical perspective on these species.\",\n\t\"license_title\": \"License
